import React from 'react';

import classNames from 'classnames'


const Button =(onClick,) =>{
    return (
      <button onClick={props.onClick}
      className = {classNames('button',props.className,{
        'button--outline' : props.outline,
      })}>
        {props.children}
      </button>
      );
  }

export default Button;
